import React from 'react';

function Home() {
  return (
    <div className="text-center">
      <h1>Chào mừng đến với ADS DEV</h1>
      <p>Chúng tôi chuyên phát triển phần mềm và giải pháp quảng cáo chuyên nghiệp.</p>
    </div>
  );
}

export default Home;
